'''L'Associazione romana studi Tolkieniani''' (Italian: Roman Association of Tolkien Studies) was founded in [[2005]] in Rome, Italy as a non-profit association. It has close links with Proudneck, a Tolkien Society smial in Rome, founded in [[2000]].{{fact}} Since its foundation it has hosted and co-organised several events on [[J.R.R. Tolkien|Tolkien]] but has no regularly recurring ones.{{fact}}

